import { useState } from "react";
// const [catArray, setCatArray] = useState([]);
const CatsDetails = (catDetail) => {
  <div>
    {console.log(catDetail.catDetail)}
    <h1>
      {catDetail.catDetail.map((catD) => (
        <h3>{catD.name}</h3>
      ))}
    </h1>
  </div>;
};

export default CatsDetails;
